cordova.define("com.jiedaibao.paycashier.PayCashier", function (require, exports, module) {
   var exec = require('cordova/exec');
   module.exports = {
       payCashier : function(tradeID, amount, ext, extParams, successCallback, errorCallback) {
       exec(
            successCallback,
            errorCallback,
            'PayCashier',
            'payCashier',
            [{
             "tradeID": tradeID,
             "amount": amount,
             "ext": ext,
             "extParams": extParams,
             }]
            );
       }
    }
  }
);
